
create table reader (
	readerId int not null primary key identity(1,1),
	email nvarchar(100),
	registerDate nvarchar(20),
	fullName nvarchar(100),
	nickName nvarchar(100),
	gender nvarchar(10),
	phone nvarchar(30),
	birth nvarchar(20),
	readerLevel int default '1',
	readerCoin int default '0',
	authority int default 2,
	password nvarchar(2000),
	photo varbinary(max)
);

drop table reader;
select * from reader;





